import React, { useState } from 'react';
import Axios from 'axios';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function RentPost() {
  const [formData, setFormData] = useState({
    vehicle_type: 'car', // Default vehicle type
    phone_number: '',
    model: '',
    price: 0,
    description: 'No description available',
    is_available: true,
    image_link: '',
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    // Make a POST request to your API to create a new rental post
    Axios.post('http://127.0.0.1:8000/api/rentals/create/', formData)
      .then((response) => {
        // Handle success, e.g., show a success message or redirect
        console.log('Rental post created successfully:', response.data);
      })
      .catch((error) => {
        // Handle error, e.g., show an error message
        console.error('Error creating rental post:', error);
      });
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary">
        <Container fluid>
          <Navbar.Brand href="http://localhost:3000">VehicleVerse</Navbar.Brand>
          <Navbar.Toggle aria-controls="vehicleerse" />
          <Navbar.Collapse id="vehicleverse">
            <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }}>
              <Nav.Link href="http://localhost:3000">Home</Nav.Link>
              <Nav.Link href="http://localhost:3000/rental">Rent</Nav.Link>
              <NavDropdown title="POST" id="navbarScrollingDropdown">
              <NavDropdown.Item href="http://localhost:3000/sell/post">ADD For Sell</NavDropdown.Item>
              <NavDropdown.Item href="http://localhost:3000/rent/post">ADD For Rent</NavDropdown.Item>
              </NavDropdown>
              <Nav.Link href="http://localhost:3000/profile">Profile</Nav.Link>
              <Nav.Link href="http://127.0.0.1:8000/login/">Log Out</Nav.Link>
            </Nav>
            <Form className="d-flex">
              <Form.Control
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
              <Button variant="outline-success">Search</Button>
            </Form>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Container className="mt-4">
        <h1 className="text-center">Create a Rental Post</h1>
        <Form onSubmit={handleSubmit}>
          <Form.Group className="mb-3">
            <Form.Label>Vehicle Type</Form.Label>
            <Form.Select name="vehicle_type" onChange={handleChange}>
              <option value="car">Car</option>
              <option value="bike">Bike</option>
            </Form.Select>
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Phone Number</Form.Label>
            <Form.Control
              type="text"
              name="phone_number"
              value={formData.phone_number}
              onChange={handleChange}
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Model</Form.Label>
            <Form.Control
              type="text"
              name="model"
              value={formData.model}
              onChange={handleChange}
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Price</Form.Label>
            <Form.Control
              type="number"
              name="price"
              value={formData.price}
              onChange={handleChange}
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Description</Form.Label>
            <Form.Control
              as="textarea"
              rows={3}
              name="description"
              value={formData.description}
              onChange={handleChange}
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Check
              type="checkbox"
              name="is_available"
              label="Available"
              checked={formData.is_available}
              onChange={(e) =>
                setFormData({ ...formData, is_available: e.target.checked })
              }
            />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Image Link</Form.Label>
            <Form.Control
              type="text"
              name="image_link"
              value={formData.image_link}
              onChange={handleChange}
            />
          </Form.Group>

          <Button variant="primary" type="submit">
            Create Post
          </Button>
        </Form>
      </Container>
    </div>
  );
}

export default RentPost;
